export default function Counter(){


    const ButtonStyle={
        fontSize : "30px",
        margin:"20px",
        padding:"10px",
        borderRadius:"10px",
        backgroundColor:"black",
        color:"white",
        width:"100px"

        
    }

    const p ={
        sum:0,
    }
    function Increamentby1(){
      console.log('Button is pressed')
    }


    return(
        <div className="Counter">
            <span className="count">{p.sum}</span>
            <div>
                <button className="Counterbutton" 
                onClick={Increamentby1}
                style={ButtonStyle}
                >+1</button>
            </div>        
            
        </div>

    );
}
